const data = require('../data/data.js');
describe('My Login application', () => {
  it('should solve challange #1', async () => {
    await _challangePage.default.openFirstChallange();
    //1-1 part: Verify Error Message when nothing is entered!
    await _challangePage.default.buttonVerify.click();
    await expect(_challangePage.default.alertText).toHaveTextContaining('No value entered in Name field!');

    //1-2 part: Verify Error Message when less than 2 letters are entered!
    await _challangePage.default.nameField.setValue(data.oneChar);
    await _challangePage.default.buttonVerify.click();
    await expect(_challangePage.default.alertText).toHaveTextContaining('Name has to have at least 2 letters!');

    //1-3 part: Verify Error Message when non letters are entered!
    await _challangePage.default.nameField.setValue(data.twoDigits);
    await _challangePage.default.buttonVerify.click();
    await expect(_challangePage.default.alertText).toHaveTextContaining('Name can only have letters!');

    //1-4 part: Verify Error Message when more than 30 letters are entered!
    await _challangePage.default.nameField.setValue(data.longText);
    await _challangePage.default.buttonVerify.click();
    await expect(_challangePage.default.alertText).toHaveTextContaining('Name cannot have more than 30 letters!');

    //1-5 part: To solve a challenge simply write your name and click VERIFY!
    await _challangePage.default.nameField.setValue(data.firstName);
    await _challangePage.default.buttonVerify.click();
    await expect(_challangePage.default.successPage).toHaveTextContaining('Wohoo!');
