import ChallangePage from '../pageobjects/challange.page.js'
import ChallangeActions from '../actions/actions.js'
const data = require('../data/data.js')

describe('My Login application', () => {  

    it('should solve challange #1', async () => {
        await ChallangePage.openFirstChallange()
        //1-1 part: Verify Error Message when nothing is entered!
        await ChallangePage.buttonVerify.click()
        await expect(ChallangePage.alertText).toHaveTextContaining('No value entered in Name field!')

        //1-2 part: Verify Error Message when less than 2 letters are entered!
        await ChallangePage.nameField.setValue(data.oneChar)
        await ChallangePage.buttonVerify.click()
        await expect(ChallangePage.alertText).toHaveTextContaining('Name has to have at least 2 letters!')

        //1-3 part: Verify Error Message when non letters are entered!
        await ChallangePage.nameField.setValue(data.twoDigits)
        await ChallangePage.buttonVerify.click()
        await expect(ChallangePage.alertText).toHaveTextContaining('Name can only have letters!')

        //1-4 part: Verify Error Message when more than 30 letters are entered!
        await ChallangePage.nameField.setValue(data.longText)
        await ChallangePage.buttonVerify.click()
        await expect(ChallangePage.alertText).toHaveTextContaining('Name cannot have more than 30 letters!')

        //1-5 part: To solve a challenge simply write your name and click VERIFY!
        await ChallangePage.nameField.setValue(data.firstName)
        await ChallangePage.buttonVerify.click()
        await expect(ChallangePage.successPage).toHaveTextContaining('Wohoo!')
        });

    it('should solve challange #2', async () => {
        await ChallangePage.openSecondChallange()

        //2-1 part: Verify Error Message when nothing is entered!
        await ChallangePage.buttonVerify.click()
        await expect(ChallangePage.alertText).toHaveTextContaining('No number is entered!')

        //2-2 part: Verify Error Message when entered number is more than 100!
        await ChallangePage.numberField.setValue(101)
        await ChallangePage.buttonVerify.click()
        await expect(ChallangePage.alertText).toHaveTextContaining('Entered number is NOT in range of 0-100!')

        //2-3 part: Verify Error Message when entered number is less than 0!
        await ChallangePage.numberField.setValue(-1)
        await ChallangePage.buttonVerify.click()
        await expect(ChallangePage.alertText).toHaveTextContaining('Entered number is NOT in range of 0-100!')

        //2-4 part:  To solve a challenge enter the number between 0 - 100 & click VERIFY!
        await ChallangePage.numberField.setValue(55)
        await ChallangePage.buttonVerify.click()
        await expect(ChallangePage.successPage).toHaveTextContaining('Wohoo!')
    });


    it('should solve challange #3', async () => {
        await ChallangePage.openThirdChallange()

        //3-1 part: Verify that Green button is disabled by default!
        await expect(ChallangePage.greenButton).toBeDisabled()

        //3-2 part: Verify that Red button is disabled by default! 
        await expect(ChallangePage.redButton).toBeDisabled()

         //3-3 part: To solve a challenge light up Lithuanian flag by clicking on all buttons starting from Yellow! 
        await ChallangePage.yelowButton.click()
        await ChallangePage.greenButton.click()
        await ChallangePage.redButton.click()
        await expect(ChallangePage.successPage).toHaveTextContaining('Wohoo!')
    });

    it('should solve challange #4', async () => {
        await ChallangePage.openFourthChallange()

