        await ChallangePage.radioButtonDev.click()
        await ChallangePage.buttonVerify.click()
        await expect(ChallangePage.alertText).toHaveTextContaining('Software Developer is selected!')
        await ChallangePage.radioButtonAnalyst.click()
        await ChallangePage.buttonVerify.click()
        await expect(ChallangePage.alertText).toHaveTextContaining('Business Analystic is selected!')
        await ChallangePage.radioButtonWriter.click()
        await ChallangePage.buttonVerify.click()
        await expect(ChallangePage.alertText).toHaveTextContaining('Technical Writer is selected!')
        await expect(ChallangePage.successPage).toHaveTextContaining('Wohoo!')
    })

    it('should solve challange #6', async () => {
        await ChallangePage.openSixthChallange()

