        //                  Verify Error Message with at least 3 countries
        await ChallangePage.countriesDropDown.selectByAttribute("value", data.countryIndex[0])
        await ChallangePage.buttonVerify.click()
        await expect(ChallangePage.alertText).toHaveTextContaining('Selected country is '+data.countryIndex[0]+', NOT Lithuania!')
        await ChallangePage.countriesDropDown.selectByAttribute("value", "Croatia")
        await ChallangePage.buttonVerify.click()
        await expect(ChallangePage.alertText).toHaveTextContaining('Selected country is Croatia, NOT Lithuania!')
        await ChallangePage.countriesDropDown.selectByAttribute("value", "Poland")
        await ChallangePage.buttonVerify.click()
        await expect(ChallangePage.alertText).toHaveTextContaining('Selected country is Poland, NOT Lithuania!')

        //6-3 part: To solve a challenge select the country Lithuania from drop down list and VERIFY it!
        await ChallangePage.countriesDropDown.selectByAttribute("value", "Lithuania")
        await expect(ChallangePage.countriesDropDown).toHaveTextContaining('Lithuania')
        await ChallangePage.buttonVerify.click() 
        await expect(ChallangePage.successPage).toHaveTextContaining('Wohoo!')
    })

    it('should solve challange #7', async () => {
        await ChallangePage.openSeventhChallange()

