        await ChallangePage.hamburgerMenuHome.click()
        await expect(ChallangePage.alertText).toHaveTextContaining('You have selected other section than VERIFY ME!')
        await ChallangePage.hamburgerMenuAbout.click()
        await expect(ChallangePage.alertText).toHaveTextContaining('You have selected other section than VERIFY ME!')
        await ChallangePage.hamburgerMenuContact.click()
        await expect(ChallangePage.alertText).toHaveTextContaining('You have selected other section than VERIFY ME!')
        await ChallangePage.hamburgerMenuBlog.click()
        await expect(ChallangePage.alertText).toHaveTextContaining('You have selected other section than VERIFY ME!')

        //7-2 part:  To solve a challenge, select the option VERIFY ME
        await ChallangePage.hamburgerMenuVerify.click()
        await expect(ChallangePage.successPage).toHaveTextContaining('Wohoo!')

    })

    it('should solve challange #8', async () => {
        await ChallangePage.openEightChallange()

        //8-1 part:  Verify Error Message when number is NOT 100. Use boundary values!
        await ChallangePage.slider.dragAndDrop({x: 180, y: 0})
        await ChallangePage.buttonVerify.click()
        await expect(ChallangePage.alertText).toHaveTextContaining('You have NOT reached 100 yet, try harder!')

        //8-2 part: To solve a challenge reach 100 and click Verify button!
        await ChallangePage.slider.dragAndDrop({x: 200, y: 0})
        await ChallangePage.buttonVerify.click()
        await expect(ChallangePage.successPage).toHaveTextContaining('Wohoo!')
    })



    it('should solve challange #9', async () => {
        await ChallangePage.openNinethChallange()

        //9-1 part:  Click Log in when nothing is entered. Verify the message!
        await ChallangePage.loginButton.click()
        await expect(ChallangePage.alertText).toHaveTextContaining('You have NOT filled Username field')

         //9-2 part:  Click Log in when Username is filled & Password is empty. Verify the message! 
        await ChallangePage.usernameField.setValue(data.username)
        await ChallangePage.loginButton.click()
        await expect(ChallangePage.alertText).toHaveTextContaining('Either password is incorrect or not filled!')

         //9-3 part:  Click Log in when Username is NOT filled & Password is filled. Verify the message!
